import React from 'react';

// containers
import Welcome from './containers/Welcome';
import Portfolio from './containers/Portfolio'

import { useMousePosition } from './helpers/hooks'

function App() {

  const position = useMousePosition();

  return (
    <Welcome render={data => (
      <Portfolio
        position={position}
        data={data} />
    )} />
  );
}

export default App;
